import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { useState, useEffect } from 'react';
import DeleteIcon from "@material-ui/icons/Delete";
import { useParams } from 'react-router';
import axios from 'axios';
import { Button } from 'react-bootstrap';

const useStyles = makeStyles((theme) => ({
    //fame
    mainFame: {
        width: 755,
        minHeight: 721,
        backgroundColor: '#FFFFFF',
        position: 'relative',
        border: '0.75px solid #AAAAAA',
        borderRadius: 5,
        // flexWrap: 'wrap'

    },
    mainFameHeader: {
        height: 85,
        width: "100%",
        borderBottom: '0.75px solid #AAAAAA'
    },
    inFame: {
        width: 605,
        minHeight: 141.5,
        position: 'relative',
        borderRadius: '5px',
        border: '0.75px solid #AAAAAA'

    },
    inFameHeader: {
        width: "100%",
        height: 86.5,
        borderBottom: '0.75px solid #AAAAAA',

    },
    //row in fame
    rominfame: {
        width: '100%',
        height: 55,
        position: 'relative'
    },
    //wrap infame
    wrapfame: {
        width: 605,
        minHeight: 360,
        margin: 'auto',
        position: 'relative'
    },
    //text
    title: {
        fontSize: '22.6px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
        top: 26.6,
        left: 42
    },
    title2: {
        fontSize: '19.4px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',

    },
    title3: {
        fontSize: '16.18px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        left: 41,
        top: 13,
        position: 'absolute'

    },
    title4: {
        fontSize: '13px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        top: 46,
        position: 'absolute'
    },
    title5: {
        fontSize: '13px',
        color: '#4A4A4A',
        position: 'absolute'
    },

    //input
    inputSize: {
        height: 31.5,
        width: 189,
        fontSize: '13px',
        color: '#4A4A4A',
        position: 'relative',
        margin: 'auto'
    },

    inputHeadNumbox: {
        width: 103.5,
        height: 31.5,
        fontSize: 13
    },
    submitHeadNumBt: {
        width: 103.5,
        height: 31.5,
        backgroundColor: '#485D84',
        color: '#FFFFFF',
        fontSize: 13,
        fontWeight: 400

    },
    //button
    buttonDelete: {
        width: 28,
        height: 28,
        borderRadius: 14.1,
        backgroundColor: '#F8F8F8',
        position: 'relative'
    },


    //decor
    decorLeftRight: {
        width: 41
    },

    grabWidth: {
        width: 17.7
    }


}));

export default function CreateRoomRe(props) {
    const classes = useStyles();
    const bull = <span className={classes.bullet}>•</span>;
    const [allroom, setAllroom] = useState([]);
    const [inputRoomToAdd, setInputRoomToAdd] = useState(null)
    const [arrayFloor, setArrayFloor] = useState(2)

    const [getRoomName, setRoomName] = useState()
    const { id } = useParams()

    const [buildingName, setBuildName] = useState([])

    useEffect(async () => {
        console.log(props.allFloor)
        console.log(id + "in Use Eff first row")
        await axios(`/building/building/id/${id}`)
            .then(response => {
                console.log(response.data, "in response")
                setBuildName(response.data[0].buildingName)

            })
            .catch(error => {
                console.log('Error getting fake data: ' + error);
            })


    }, []);

    useEffect(() => {
        setArrayFloor(props.allFloor)
        axios('/building/rooms/1')
            .then(response => {
                // console.log("hi" + response.data)
                setAllroom(response.data);
            })
            .catch(error => {
                console.log('Error getting fake data: ' + error);
            })
        console.log("In useeffect")
    }, [inputRoomToAdd]);



    // building/floor-room/building/5


    const api = axios.create({
        baseURL: `/building/floor-room/building/${id}`
    })

    const addFloorandRoom = async () => {
        let res = await api.post('/',
            arrayFloor
        ).then(response => {
            alert("Add Room successfully")
            window.location.href = `/st_initialize/${id}`;
        })
            .catch(error => {
                alert("Fail")
                console.log('Error getting fake data: ' + error);
            })

    }

    function handlerClick() {
        const a = 100
        // inputRoomToAdd
        // allroom
        const roomObject = {
            "room_number": "101"
        }
        console.log(arrayFloor)

        for (var i = 0; i < arrayFloor.length; i++) {

            for (var j = 0; j < parseInt(inputRoomToAdd); j++) {
                const formattedNumber = ("0" + (j + 1)).slice(-2)
                const roomNumber = String(i + 1) + formattedNumber
                const roomObject = {
                    "room_number": roomNumber
                }
                arrayFloor[i].Rooms.push(roomObject)
                console.log(roomNumber)
            }
        }

        setArrayFloor(arrayFloor)
        console.log(arrayFloor)

        console.log("end")

    }


    return (
        <div>

        </div>

    )
}
